import React, { useState } from 'react';
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch,
} from 'react-router-dom';

import './App.css';
import { AuthContext } from './shared/context/auth-context';
import MainNavigation from './shared/components/Navigation/MainNavigation';
import Players from './players/pages/Players';
import Auth from './user/pages/Auth';
import NewPlayer from './players/pages/NewPlayer';
import PlayerDetails from './players/pages/PlayerDetails';

const MOCK_PLAYERS = [
  {
    id: 'p1',
    name: 'Novak Djokovic',
    country: 'Serbia',
    age: 33,
    grand_slams: 17,
    ranking: null,
    points: 12030,
    image:
      'https://e0.365dm.com/20/12/768x432/skysports-roger-federer-australian-open_5206630.jpg?20201214070638',
  },
  {
    id: 'p2',
    name: 'Rafael Nadal',
    country: 'Spain',
    age: 34,
    grand_slams: 20,
    ranking: null,
    points: 9850,
    image:
      'https://e0.365dm.com/20/12/768x432/skysports-roger-federer-australian-open_5206630.jpg?20201214070638',
  },
  {
    id: 'p3',
    name: 'Roger Federer',
    country: 'Switzerland',
    age: 39,
    grand_slams: 20,
    ranking: null,
    points: 16630,
    image:
      'https://e0.365dm.com/20/12/768x432/skysports-roger-federer-australian-open_5206630.jpg?20201214070638',
  },
  {
    id: 'p4',
    name: 'Daniil Medvedev',
    country: 'Russia',
    age: 24,
    grand_slams: 0,
    ranking: null,
    points: 8470,
    image:
      'https://e0.365dm.com/20/12/768x432/skysports-roger-federer-australian-open_5206630.jpg?20201214070638',
  },
  {
    id: 'p5',
    name: 'Dominic Thiem',
    country: 'Austria',
    age: 27,
    grand_slams: 1,
    ranking: null,
    points: 9470,
    image:
      'https://e0.365dm.com/20/12/768x432/skysports-roger-federer-australian-open_5206630.jpg?20201214070638',
  },
];

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const login = () => {
    console.log('LOGING IN!');
    setIsLoggedIn(true);
  };

  const logout = () => {
    console.log('LOGING OUT!');
    setIsLoggedIn(false);
  };

  let routes;

  routes = (
    <Switch>
      <Route path="/" exact>
        <Players />
      </Route>
      <Route path="/auth" exact>
        <Auth />
      </Route>
      <Route path="/players/new" exact>
        <NewPlayer />
      </Route>
      <Route path="/player/:pid" exact>
        <PlayerDetails />
      </Route>
      <Redirect to="/" />
    </Switch>
  );

  return (
    <AuthContext.Provider
      value={{
        isLoggedIn: isLoggedIn,
        login: login,
        logout: logout,
        tennisPlayers: MOCK_PLAYERS,
      }}
    >
      <Router>
        <MainNavigation />
        <main>{routes}</main>
      </Router>
    </AuthContext.Provider>
  );
}

export default App;
